import React from 'react';

const input = props => {

  let inputElement = null;
  const { elementType } = props;

  switch (elementType) {
    case 'search':
      inputElement = (
        <input type="text" />
      )
      break;
    default:
      elementType = null
  }

  return (
    { inputElement }
  )
}

export default input
